    var lastFocusedInput = $('input[type=\'text\']:eq(0)');
    DOC.on('click', 'input[type=\'text\'], input[type=\'password\']', function () {
      lastFocusedInput = $(this);
    });

    function buttonClick(target) {
      if (!lastFocusedInput) {
        return;
      }

      var value = target.text();
      var caretPos = lastFocusedInput.caret();

      if (value === 'C') {
        lastFocusedInput.val('');
      } else if (value === '<') {
        lastFocusedInput.range(caretPos - 1, caretPos).range('').val();
      } else {
        lastFocusedInput.caret(caretPos).caret(value);
      }

      lastFocusedInput.focus().change();

    }

    DOC.on('click', '.keyboard a', function (e) {
      e.preventDefault();
      buttonClick($(this));
    });

